UPDATE LL
SET
	PerformanceCategory = '13'

FROM
	CDW.FsaInvMet.Monthly_LoanLevel LL
	INNER JOIN
	(
select distinct * from (
SELECT distinct
	PD10.DF_SPE_ACC_ID,
CASE 
	WHEN (FB10.LC_STA_FOR10 = 'I' and ln60.LC_STA_LON60 = 'I') AND FB10.LF_LST_DTS_FB10 BETWEEN '08-01-2020' AND '09/01/2020' THEN 'Y'
	WHEN FB10.LC_STA_FOR10 = 'A' and ln60.LC_STA_LON60 = 'A' THEN 'Y'
 END inc,
 fb10.bf_ssn,
 ll.LN_SEQ,
 ll.PerformanceCategory
--*                                
		FROM 
			CDW..FB10_BR_FOR_REQ FB10
			INNER JOIN CDW..LN60_BR_FOR_APV LN60 
				ON FB10.BF_SSN = LN60.BF_SSN 
				AND FB10.LF_FOR_CTL_NUM = LN60.LF_FOR_CTL_NUM
			inner join @data d
				on d.bf_ssn = fb10.BF_SSN
			INNER JOIN CDW.[FsaInvMet].[Monthly_LoanLevel] LL
				ON LL.BF_SSN = FB10.BF_SSN
			INNER JOIN CDW..PD10_PRS_NME PD10
				ON PD10.DF_PRS_ID = FB10.BF_SSN
		WHERE
			FB10.LC_FOR_STA = 'A'
			--AND LN60.LC_STA_LON60 = 'A'
			-- and FB10.LC_STA_FOR10 = 'A'
			AND LN60.LC_FOR_RSP != '003'      
			and FB10.LC_FOR_TYP = '41'
			AND CAST(LN60.LD_FOR_END AS DATE) >= CAST(DATEADD(D,-(DAY(GETDATE())),GETDATE()) AS DATE) /*Last Day Prev Month*/
			AND CAST(LN60.LD_FOR_APL AS DATE) <= CAST(DATEADD(D,-(DAY(GETDATE())),GETDATE()) AS DATE) /*Last Day Prev Month*/
			AND CAST(LN60.LD_FOR_BEG AS DATE) <= CAST(DATEADD(D,-(DAY(GETDATE())),GETDATE()) AS DATE) /*Last Day Prev Month*/
		
) p
	where p.inc = 'y'
	and p.PerformanceCategory = '06'
) POP
	ON POP.BF_SSN = LL.BF_SSN
	AND POP.LN_SEQ = LL.LN_SEQ	
	
